import React from "react";
import Layout from "./Layout";
import { Box, AppBar, Toolbar } from "@mui/material";

function Header() {
  return (
    <div>
      <Box>
        <AppBar component={"saas"} sx={{ bgcolor: "black" }}>
          <Toolbar>
            <p>My Restaurant</p>
          </Toolbar>
        </AppBar>
      </Box>
    </div>
  );
}

export default Header;
